import React, { useState, useEffect } from 'react';
import { Routes, Route, Navigate, Link } from 'react-router-dom';
import './menu.css';
import ValidateOrder from './components/ValidateOrder';
import Product from './components/Product';
import CartPage from './components/CartPage';
import Modal from './components/Modal';
import DeliveryPage from './components/DeliveryPage';
import products from './productsData';

function App() {
    const [cart, setCart] = useState([]);
    const [selectedProduct, setSelectedProduct] = useState(null);
    const [shuffledProducts, setShuffledProducts] = useState([]);
    const [newProducts, setNewProducts] = useState([]);

    // Mélanger les produits et séparer les nouveautés
    useEffect(() => {
        const shuffleProducts = (products) => [...products].sort(() => Math.random() - 0.5);
        setShuffledProducts(shuffleProducts(products.filter((product) => !product.isNew)));
        setNewProducts(products.filter((product) => product.isNew));
    }, []);

    // Ajouter un produit au panier
    const addToCart = (product, quantity) => {
        setCart((prevCart) => {
            const existingProductIndex = prevCart.findIndex((item) => item.id === product.id);
            if (existingProductIndex >= 0) {
                const updatedCart = [...prevCart];
                updatedCart[existingProductIndex].quantity += quantity;
                return updatedCart;
            } else {
                return [...prevCart, { ...product, quantity }];
            }
        });
    };

    // Supprimer un produit du panier
    const removeFromCart = (productId) => {
        setCart((prevCart) => prevCart.filter((item) => item.id !== productId));
    };

    // Vider le panier
    const emptyCart = () => {
        setCart([]);
    };

    // Gérer l'affichage des détails d'un produit
    const handleProductClick = (product) => {
        setSelectedProduct(product);
    };

    return (
        <div className="App">
            {/* Barre de recherche et icône du panier */}
            <div className="top-bar-first-line">
                <div className="logo-line">
                    <img src="link_logo.png" alt="Logo Whilf Rede" />
                </div>
                <Link to="/cart" className="cart-icon">
                    <i className="fas fa-shopping-cart"></i>
                    <span className="cart-count">{cart.length}</span>
                </Link>
            </div>

            <div className="separator"></div>

            {/* Routes */}
            <Routes>
                {/* Redirection de la route / vers /menu */}
                <Route path="/" element={<Navigate to="/menu" />} />

                {/* Page menu */}
                <Route
                    path="/menu"
                    element={
                        <>
                            {/* Produits classiques */}
                            <section className="product-section">
                                <h2 className="section-title">Produits Classiques</h2>
                                <div className="product-grid">
                                    {shuffledProducts.map((product) => (
                                        <Product
                                            key={product.id}
                                            product={product}
                                            onProductClick={handleProductClick}
                                        />
                                    ))}
                                </div>
                            </section>

                            {/* Nouveautés */}
                            <section className="product-section">
                                <h2 className="section-title">Nouveautés</h2>
                                <div className="product-grid">
                                    {newProducts.map((product) => (
                                        <Product
                                            key={product.id}
                                            product={product}
                                            onProductClick={handleProductClick}
                                        />
                                    ))}
                                </div>
                            </section>

                            {/* Autres Produits */}
                            <section className="product-section">
                                <h2 className="section-title">Autres Produits</h2>
                                <div className="product-grid">
                                    {shuffledProducts.map((product) => (
                                        <Product
                                            key={product.id}
                                            product={product}
                                            onProductClick={handleProductClick}
                                        />
                                    ))}
                                </div>
                            </section>
                        </>
                    }
                />

                {/* Page du panier */}
                <Route path="/cart" element={<CartPage cart={cart} onRemoveFromCart={removeFromCart} />} />

                {/* Page de livraison */}
                <Route path="/delivery" element={<DeliveryPage />} />

                {/* Page de validation de commande */}
                <Route
                    path="/validate-order"
                    element={<ValidateOrder cartItems={cart} onEmptyCart={emptyCart} />}
                />
            </Routes>

            {/* Modal pour afficher les détails d'un produit sélectionné */}
            {selectedProduct && (
                <Modal
                    product={selectedProduct}
                    onClose={() => setSelectedProduct(null)}
                    onAddToCart={addToCart}
                />
            )}
        </div>
    );
}

export default App;
